import React, { Component } from 'react';
import {
    Nav,
    NavItem,
    NavbarBrand,
    Navbar,
    NavLink,
    Button
} from 'reactstrap';

class HeaderComponent extends Component {
    render() {
        return (
            <div>
                <Navbar color="light" light expand="md">
                    <NavbarBrand onClick={this.props.onClick}>CartonCloud</NavbarBrand>
                    <Nav className="ml-auto" navbar>
                        <NavItem>
                            <NavLink href="#name">Deliveries</NavLink>
                        </NavItem>
                        <NavItem>
                            <Button color = "primary"onClick={this.props.onClick}>New Delivery</Button>
                        </NavItem>
                    </Nav>
                </Navbar>
            </div>
        );
    }
}

export default HeaderComponent;
